import React from 'react';
import "./Navbar.css"
import {Link} from "react-router-dom";
function Navbar() {
    return (  
        <>
        <div id="headernav">
            <img src="./images/logobook.png" alt="Logo"/>
            <ul>
                <li><a href='#'>Home</a></li>
               
                <li><Link to="/categories">Categories</Link></li>
                <li><a href='#'>Sign Out</a></li>
                
            </ul>
        </div>
        </>
    );
}

export default Navbar;
